import React from 'react';
import PropTypes from 'prop-types';

const Contacts = ({ name, phone }) => {
  return (
    <div>
      <span>{name}</span>
      <span>{phone}</span>
    </div>
  );
};

Contacts.propTypes = {};

export default Contacts;
